import Head from "next/head";

const HeadMeta = () => {
  return (
    <Head>
      <title>Create Next App</title>
      <link rel="icon" href="/favicon.ico" />
      <link rel="stylesheet" href="/assets/css/webfonts.css" />
    </Head>
  );
};
export default HeadMeta;
